import Brand from './Brand'
import CartWidget from './CartWidget'

let navBarStyle = {
    "backgroundColor": "black",
    "padding-top":"10px",
    "padding-bottom":"5px",
    "display":"flex",
    "flex-flow":"row",
    "align-content": "center"
}

function NavBar() {
                    return (
                        <div style={navBarStyle}>
                            <Brand />
                            <CartWidget />
                        </div>
                    );
}

export default NavBar;
